in','2014-09-28 13:58:42','This pampering service includes a moisturizing massage with rich, warm cream, leaving hands velvety smooth.','all','/images/products/Warm_cream_manicure.jpg',1,'\0','admin','2014-09-28 13:58:42','Warm cream manicure','4028818948baf02a0148bafa30810000'),('4028818948baf02a0148bb649a0600ae','admin','2014-09-28 14:03:25','This pampering service includes a moisturizing massage with rich, warm cream, leaving hands velvety smooth.','all','/images/products/Warm_cream_pedicure.jpg',1,'\0','admin','2014-09-28 14:03:25','Warm cream pedicure','4028818948baf02a0148bafa30810000');

